INSERT INTO `hint` (`id`, `idChallenge`, `formation`, `hint`, `challengeName`) VALUES
(27, 1, 'LYCEE', 'L\' Empereur  de Rome Jules César avait l\'habitude de chiffrer toutes ses communications  avec les généraux de ses armées. Le code s’appelle maintenant le code cesar Il consiste à décaler tous l’alphabet de 3 lettres. mais il y a des variantes …\nA vous de trouvez.  \n', 'Salade Cesar (fwuo x)'),
(28, 3, 'LYCEE', 'Le Flag précédent était aussi un indice pour trouver le prochain flag.Enregistrez l’image trouvée dans le dossier” college/escapeGame/” .Une image peut cacher du texte .Pour l’extraire il faut utiliser la commande suivante:\n “steghide extract -sf locked.jpg. “\nLa commande se lance dans un terminal.\n', 'Steghide'),
(30, 4, 'LYCEE', 'Le Flag précédent était aussi un indice pour CALCULER  le prochain flag.\n', '1,2,3,Soleil'),
(31, 5, 'LYCEE', 'Le code Morse est utilisé depuis la nuit des temps pour communiquer sur des longues distances. Saviez-vous que l\'on peut utiliser avec : \n-des signaux de fumée\n-des signaux de lumière\n-des ondes RADIOS …\n\n-des signaux de fumée\n-des signaux de lumière\n-des ondes RADIOS …\n\n-des signaux de fumée\n-des signaux de lumière -\n-des ondes RADIOS …\n', 'Code Morse'),
(32, 6, 'LYCEE', 'Allez dans le dossier Memory avec la commande “cd memory” puis lancer le jeu avec “./compile”\n', 'Memory'),
(33, 7, 'LYCEE', 'Allez dans le dossier Pendu avec la commande “cd ../Pendu ” puis lancer le jeu avec “./pendu.sh”\n', 'Pendu'),
(34, 8, 'LYCEE', 'Allez dans le dossier Mail avec la commande “cd ../mail ” . Votre mission va être de détecter parmi ces mails douteux de phishing celui qui est fiable. Le flag est la signature de l\'expéditeur.', 'Phishing'),
(35, 9, 'LYCEE', 'http://10.122.13.224/ENIGMAHACK/Project/secret.php', 'Rebus'),
(36, 2, 'LYCEE', 'Le Flag précédent était aussi un indice pour trouver le prochain flag.\r\n', 'code source');
